@testset "2.3 Exponential functions" begin
	@test integrate(exp(x/(4 + 6*E^x)), x) == :((1/6)*log(2 + 3*exp(x)))
	@test integrate(exp(x/(a + b*E^x)), x) == :(log(a + b*exp(x))/b)
	@test integrate(exp((d*x)/(a + b*E^(c + d*x))), x) == :(log(a + b*exp((c + d*x)))/(exp(c*(b*d))))
	@test integrate(exp((c + d*x)/(a + b*E^(c + d*x))), x) == :(log(a + b*exp((c + d*x)))/(b*d))
	@test integrate(exp(x*(a + b*E^x)^n), x) == :((a + b*exp(x)^(1 + n)/(b*(1 + n))))
	@test integrate(exp((d*x)*(a + b*E^(c + d*x))^n), x) == :((a + b*exp((c + d*x))^(1 + n)/(E^c*(b*d*(1 + n)))))
	@test integrate(exp((c + d*x)*(a + b*E^(c + d*x))^n), x) == :((a + b*exp((c + d*x))^(1 + n)/(b*d*(1 + n))))
	@test integrate(F^x/(a + b*F^x), x) == :(log(a + b*F^x)/(b*log(F)))
	@test integrate(F^(d*x)/(a + b*F^(c + d*x)), x) == :(log(a + b*F^(c + d*x))/(F^c*(b*d*log(F))))
	@test integrate(F^(c + d*x)/(a + b*F^(c + d*x)), x) == :(log(a + b*F^(c + d*x))/(b*d*log(F)))
	@test integrate(F^x*(a + b*F^x)^n, x) == :((a + b*F^x)^(1 + n)/(b*(1 + n)*log(F)))
	@test integrate(F^(d*x)*(a + b*F^(c + d*x))^n, x) == :((a + b*F^(c + d*x))^(1 + n)/(F^c*(b*d*(1 + n)*log(F))))
	@test integrate(F^(c + d*x)*(a + b*F^(c + d*x))^n, x) == :((a + b*F^(c + d*x))^(1 + n)/(b*d*(1 + n)*log(F)))
