	@test integrate(exp((2*x)/(a + b*E^x)), x) == :(exp(x/b - (a*log)(a + b*exp(x)))/b^2)
	@test integrate(exp((2*x)/(a + b*E^x)^2), x) == :(a/(b^2*(a + b*exp(x)) + log)(a + b*exp(x))/b^2)
	@test integrate(exp((2*x)/(a + b*E^x)^3), x) == :(exp((2*x)/(2*a*(a + b*E^x)^2)))
	@test integrate(exp((2*x)/(a + b*E^x)^4), x) == :(a/(3*b^2*(a + b*exp(x)^3) - 1/(2*b^2*(a + b*E^x)^2)))
	@test integrate(exp((4*x)/(a + b*E^(2*x))), x) == :(exp((2*x)/(2*b) - (a*log)(a + b*exp((2*x))))/(2*b^2))
