	@test integrate(exp((4*x)/(a + b*E^(2*x))^3), x) == :(exp((4*x)/(4*a*(a + b*E^(2*x))^2)))
	@test integrate(exp((4*x)/(a + b*E^(2*x))^4), x) == :(a/(6*b^2*(a + b*exp((2*x))^3) - 1/(4*b^2*(a + b*E^(2*x))^2)))
